var last_play;

function my_container(index) {
	if (last_play != index) {
		last_play = index;
		clear_it(2);
		cs('data')[index].style.backgroundColor = '#00000078';
		v_img = cs('data')[index].getElementsByTagName('img');
		// if (v_img[0]) v_img[0].style.animation = '8s linear 0s infinite normal none running spin';
		cs('play')[index].innerHTML = '';
		cs('play')[index].style.backgroundColor = '#9438389c';
		cs('download')[index].style.backgroundColor = '#847c3e';
		// cs('time')[index].innerHTML = '<span class="amplitude-current-minutes">00</span>:<span class="amplitude-current-seconds">00</span> - <span class="amplitude-duration-minutes">00</span>:<span class="amplitude-duration-seconds">00</span>';
		// cs('time')[index].style.display = 'initial';
		// cs('volume')[index].innerHTML = '<span class="step"></span><span class="step"></span><span class="step"></span><span class="step"></span><span class="step"></span><span class="step"></span><span class="step"></span><span class="step"></span><span class="step"></span><span class="step"></span><span class="p-v"><input type="range" class="amplitude-volume-slider" step=".1"></span>';
		// cs('rewind')[index].innerHTML = '<div id="p-c"><input type="range" class="amplitude-song-slider" step="0.1"><div class="buffered"></div><div class="played"></div></div>';
		
		// my_arrow(doc('p-c'));
		
		rendering_play(0);
		
	    meta = Amplitude.getActiveSongMetadata();
	  
        if ('mediaSession' in navigator) {
		  
		navigator.mediaSession.playbackState = "playing";

        navigator.mediaSession.metadata = new MediaMetadata({
        title: meta.title,
        artist: meta.artist,
        album: meta.title
        });
  
	    }
	    
		track_name(index);
		player_download_link(index);
		Amplitude.bindNewElements();
		Amplitude.playSongAtIndex(index);
		return 0;
	}
	if (last_play == index) {
		if (Amplitude.getPlayerState() == 'paused') {
			
			navigator.mediaSession.playbackState = "playing";
			
			v_img = cs('data')[index].getElementsByTagName('img');
			// if (v_img[0]) v_img[0].style.animation = '8s linear 0s infinite normal none running spin';
			cs('play')[index].innerHTML = '';
			cs('play')[index].style.backgroundColor = '#9438389c';
			rendering_play(0);
			Amplitude.play();
			return 0;
		}
		if (Amplitude.getPlayerState() == 'playing') {
			
			navigator.mediaSession.playbackState = "paused";
			
			v_img = cs('data')[index].getElementsByTagName('img');
			if (v_img[0]) v_img[0].style.animation = 'none';
			cs('play')[index].innerHTML = '';
			cs('play')[index].style.backgroundColor = '#847c3e';
			rendering_play(1);
			Amplitude.pause();
			return 0;
		}
	}
}

/* dynamic */

/* init */

function super_init() {
	last_play = -1;
	items = cs('data');
	l_items = items.length;
	for (i = 0; i < l_items; i++) {
		artist = items[i].childNodes[1].childNodes[0].childNodes[0].childNodes[0].innerHTML;
		title = items[0].childNodes[1].childNodes[0].childNodes[2].childNodes[0].innerHTML;
		url = cs('link')[i].href;
		url = url.replace('/download/', '/play/');
		ex = url.split('/');
		url_new = ex[0] + '//' + ex[2] + '/' + ex[3] + '/' + ex[4] + '/' + ex[5] + '/' + i + '.mp3';
		if (i == 0) {
			Amplitude.init({
				'preload': 'none',
				'continue_next': false,
				'songs': [{
					'name': title,
					'artist': artist,
					'album': 'nope',
					'url': url_new,
					'cover_art_url': 'nope'
				}],
				'visualizations': [{
					object: BarVisualization,
					params: {}
				}],
				'callbacks': {
					'ended': function() {		
				
						/* .    . */
						
                        if (my_repeat == 1) {
                        index = Amplitude.getActiveIndex();
                        setTimeout(function() {
                        Amplitude.playSongAtIndex(index);
                        }, 1000);
						return 0;
						}
						
						all = Amplitude.getSongs().length;
						index = Amplitude.getActiveIndex();
						index++;
						if (index >= all) index = 0;
						my_container(index);
					},
					'volumechange': function() {
						vol_count++;
						volume_icon();
					},
					'timeupdate': function() {
						cs('p-played')[0].style.width = Amplitude.getSongPlayedPercentage() + '%';
					},
					'progress': function() {
						cs('p-b')[0].style.width = Amplitude.getBuffered() + '%';
					},
					'error': function() {
						all = Amplitude.getSongs().length;
						index = Amplitude.getActiveIndex();
						index++;
						if (index >= all) index = 0;
						my_container(index);
					}
				}
			});
		} else {
			Amplitude.addSong({
				'name': 'nope',
				'artist': 'nope',
				'album': 'nope',
				'url': url_new,
				'cover_art_url': 'nope'
			});
		}
	} // for
}

super_init();

function micro_init() {
	$('.play').unbind();
	$('.play').click(function() {
		index = $(this).attr('track-index');
		my_container(index);
	});
	$('.cover').unbind();
	$('.cover').click(function() {
		index = $(this).attr('track-index');
		my_container(index);
	});
	
	  $('.p-prev').unbind();

  $('.p-prev').click(function() {

      index = Amplitude.getActiveIndex();

      index--;

    if (index > -1) {

      my_container(index);

    }

  });

  $('.p-next').unbind();

  $('.p-next').click(function() {

      index = Amplitude.getActiveIndex();

      index++;   

    all = Amplitude.getSongs().length;

    if (index < all) {

      my_container(index);

    }

  });
}

micro_init();

$('.p-p').click(function() {

  index = Amplitude.getActiveIndex();

  my_container(index);

});

